// import { Counter } from './features/counter/Counter';
import './App.css';
import TaskInput from './features/todo/TaskInput';
import TaskList from './features/todo/TaskList';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        Task List
      <TaskInput />
      <TaskList />
      </header>
    </div>
  );
}

export default App;
